							SET stxt = SUBSTRING(stxt, cur_pos + pemisah_length);
							SET cur_pos = INSTR(stxt, pemisah);
							SET cur_string = LEFT(stxt, cur_pos - 1);
							SET cur_string = TRIM(REPLACE(cur_string," ",""));
